import React from 'react';
import './LoginPage.css';
import { IonPage, IonHeader, IonContent, IonTitle } from "@ionic/react"
function LoginForm() {
    var login_form = (

        <IonPage>
            <IonHeader>
                <IonTitle>letterBox</IonTitle>letterBox</IonHeader>
            <IonContent>
                <form>
                    <input className="input-style" placeholder="Name" type="text" /><br></br>
                    <input className="input-style" placeholder="Phone" type="tel" maxLength="10" />
                    <input className="input-style" placeholder="Passcode" type="password" />
                </form>
            </IonContent>

        </IonPage>
    );

    return login_form;
};

export default LoginForm;
